import "./BottomLeftMenu.css";
import pancake from "../../Images/pancake.jpeg";

function BottomLeftMenu() {
  return (
    <div className="container">
      <img src={pancake} alt="pancake-dessert" />
      <div className="bottom-left">
        <h1 className="top-left-name">Pancake</h1>
        <p className="top-left-description">
          Млечно - Бело - Темно чоколадо, банана, јагода, пченично брашно,
          путер, млеко, квасец, сол, шеќер, јајца, ванилин, вода.
        </p>
        <h6 className="top-left-alergy">
          АЛЕРГЕН: Млеко, глутен, кикирики, јајца
        </h6>
        <h1 className="top-left-price">230den</h1>
      </div>
    </div>
  );
}

export default BottomLeftMenu;
